import React from 'react';
import axios from 'axios';
import { useState, useEffect } from 'react';

const Bugs = (props) => {

    const [bugs, setBugs] = useState("");

const {month} = props
const {hour} = props

    useEffect(() => {
        axios.get(`https://acnhapi.com/v1a/bugs/`)
            .then(response => {
                console.log(response.data);
                setBugs(response.data)
            })
            .catch(error => {
                console.log(error)
            })
    }, []);


// const result = bugs.filter(bug => bug.availability.monthArrayNorthern.includes(month) && bug.availability.timeArray.includes(hour))

    return (
        <div>

            {/* {JSON.stringify(bugs)} */}
            <h1>Bugs</h1>
            {bugs ?
                bugs.map((bug, idx) => {
                    return (
                        <>
                            <img key={bug.id} style={{ width: "75px" }} key={bug.id} src={`https://acnhapi.com/v1/images/bugs/${bug.id}`} />
                        </>
                    )
                })
                :
                <p>Loading..</p>}
        </div>)
};

export default Bugs;
